import React, { Component } from 'react';
import './ListItem.css';
 
class ListItem extends Component{
    constructor(props){
        super(props);
    }
    render(){
        if(this.props.done){
            return(
                <div>
                    <p>this.props.content</p>
                </div>
            );
        }
    }
}

export default ListItem;
